import React, { Component } from "react";
import Logo from "../images/samara.png";

export default class Home extends Component {
  render() {
    return (
      <div className="home">
        <img src={Logo} alt={Logo} className="samara-logo" />
        <h2 className="name">Samara Atanielly</h2>
      </div>
    );
  }
}
